import logo from "./logo.svg";
import "./App.css";

const App = () => {
  return (
    <div>
      <div><Header /></div>
      <div className="App">ЖОПА</div>
    </div>
  );
};

const Header = () => {
  return (
    <div>
      <a>Home</a>
      <a>News read</a>
      <a>Message</a>
    </div>
  );
};

export default App;
